import "../../assets/css/main.css"
import "../../assets/css/style.css"
import { Link } from 'react-router-dom';
import useLazyLoad from "../hooks/useLazyLoading";
import { LazyLoadImage } from 'react-lazy-load-image-component';
import 'react-lazy-load-image-component/src/effects/blur.css';

function HomeServiceBox(props){
    const [src, imgRef] = useLazyLoad(props.servImg);
    return (
        <Link to={props.link} className="homeServiceBox">
            <article className="homeServiceBoxThumbnail">
                <LazyLoadImage src={props.servImg} ref={imgRef} loading="lazy" alt="" />
            </article>
            <article className="homeServiceBoxDetails">
                <h3>{props.servTitle}</h3>
                <p>{props.servDesc}</p>
                <article className="homeServiceBoxBtn">Explore More</article>
            </article>
        </Link>
    );
}

export default HomeServiceBox;
